    <div class="wrapper" >
        <div class="q1">
            <div class="wrap-question">
                <div class="question">
                </div>
            </div>
            <div class="wrap-select" @click="selectOption">
                <p data-gender="男"><span>A</span><span>男性</span></p>
                <p data-gender="女"><span>B</span><span>女性</span></p>
            </div>
            <div class="next" @click="navigateToTwo">
            </div>
        </div>
    </div>
</template>

<script>
import axios from 'axios';
import Qs from 'qs';
export default {
    data(){
        return{
            
        }
    },
    components: {
    },
    methods:{
       navigateToTwo: function() {
        // 判断是男的还是女的。如果是女的，跳转至2-1；如果是男的，跳转至2-
        // 跳转前设置localStorage，属性为gender
        let selected = document.querySelector('.selected');
        if (selected != null) {
            let gender = selected.getAttribute('data-gender');
            if (gender === '男') {
                localStorage.setItem('gender', '男');
                this.$router.push({path: 'two2'})
            } else {
                localStorage.setItem('gender', '女');
                this.$router.push({path: 'two'})
            }
        }
       },
       selectOption: function(e) {
        e.preventDefault();
        //  获取所有的p元素并经class置为空
        //  选中当前选中的选项
        let p = document.querySelectorAll('.wrap-select p');
        if (e.target.parentNode.nodeName.toLowerCase() === 'p') {
            p.forEach((item) => {item.classList = ''});
            e.target.parentNode.classList.add('selected');
        }
       }
    },
    created(){

    },
    mounted(){
       
    },
    destroyed(){

    }
}
</script>

